import React from "react";
import Card from "./Card";
const data = [
  {
    iconUrl: "images/icon-facebook.svg",
    userName: "@nathanf",
    stat: "1987",
    statType: "FOLLOWERS",
    voteIconType: "up",
    noOfVotes: 12,
  },
  {
    iconUrl: "images/icon-twitter.svg",
    userName: "@nathanf",
    stat: "1044",
    statType: "FOLLOWERS",
    voteIconType: "up",
    noOfVotes: 99,
  },
  {
    iconUrl: "images/icon-instagram.svg",
    userName: "@realnathanf",
    stat: "11k",
    statType: "FOLLOWERS",
    voteIconType: "up",
    noOfVotes: 1099,
  },
  {
    iconUrl: "images/icon-youtube.svg",
    userName: "Nathan F.",
    stat: "8239",
    statType: "SUBSCRIBERS",
    voteIconType: "down",
    noOfVotes: 144,
  },
];

function DashBoardRow(props) {
  let i = 0;
  return (
    <div className="dashboard-row">
      {data.forEach((elem) => {
        return (
          <Card
            iconUrl={elem.iconUrl}
            userName={elem.userName}
            stat={elem.stat}
            statType={elem.statType}
            voteIconType={elem.voteIconType}
            noOfVotes={elem.noOfVotes}
            className={`col-${i} col`}
            key={i++}
          ></Card>
        );
      })}
    </div>
  );
}
export default DashBoardRow;
